o_order_id` (`order_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__j2store_orderitemattributes` (   `orderitemattribute_id` int(11) NOT NULL AUTO_INCREMENT,   `orderitem_id` int(11) NOT NULL,   `productattributeoption_id` int(11) NOT NULL,   `productattributeoptionvalue_id` int(11) NOT NULL,   `orderitemattribute_name` varchar(255) NOT NULL,   `orderitemattribute_value` varchar(255) NOT NULL,   `orderitemattribute_price` decimal(12,5) NOT NULL,   `orderitemattribute_code` varchar(255) NOT NULL,   `orderitemattribute_prefix` varchar(1) NOT NULL,   `orderitemattribute_type` varchar(255) NOT NULL,   PRIMARY KEY (`orderitemattribute_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__j2store_orderitems` (   `orderitem_id` int(11) NOT NULL AUTO_INCREMENT,   `order_id` int(11) DEFAULT NULL,   `product_id` int(11) DEFAULT NULL,   `orderitem_attributes` text NOT NULL COMMENT 'A CSV of productattributeoption_id values, always in numerical order',   `orderitem_attribute_names` text NOT NULL COMMENT 'A CSV of productattributeoption_name values',   `orderitem_sku` varchar(64) NOT NULL DEFAULT '',   `orderitem_name` varchar(64) NOT NULL DEFAULT '',   `orderitem_quantity` int(11) DEFAULT NULL,   `orderitem_price` decimal(15,5) NOT NULL DEFAULT '0.00000' COMMENT 'Base price of the item',   `orderitem_attributes_price` varchar(64) NOT NULL COMMENT 'The increase or decrease in price per item as a result of attributes. Includes + or - sign',   `orderitem_discount` decimal(15,5) NOT NULL DEFAULT '0.00000' COMMENT 'Coupon discount applied to each item',   `orderitem_final_price` decimal(15,5) NOT NULL DEFAULT '0.00000' COMMENT 'Price of item inclusive of quantity, attributes, tax, and shipping',   `orderitem_tax` decimal(15,5) NOT NULL DEFAULT '0.00000',   `orderitem_shipping` decimal(12,5) NOT NULL DEFAULT '0.00000',   `orderitem_shipping_tax` decimal(12,5) NOT NULL DEFAULT '0.00000',   `orderitem_status` char(1) DEFAULT NULL,   `modified_date` datetime NOT NULL COMMENT 'GMT',   PRIMARY KEY (`orderitem_id`),   KEY `idx_order_item_order_id` (`order_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__j2store_orders` (   `id` int(11) NOT NULL AUTO_INCREMENT,   `order_id` varchar(255) NOT NULL DEFAULT '',   `shipping_method_id` int(11) NOT NULL,   `user_id` int(11) NOT NULL,   `user_email` varchar(255) NOT NULL,   `order_shipping_tax` decimal(10,2) NOT NULL,   `token` varchar(255) NOT NULL,   `orderpayment_type` varchar(255) NOT NULL DEFAULT '' COMMENT 'Element name of payment plugin',   `orderpayment_amount` decimal(15,5) DEFAULT '0.00000',   `orderpayment_tax` decimal(15,5) DEFAULT '0.00000',   `order_total` decimal(15,5) NOT NULL DEFAULT '0.00000',   `order_subtotal` decimal(15,5) NOT NULL DEFAULT '0.00000',   `order_tax` decimal(10,2) NOT NULL DEFAULT '0.00',   `order_shipping` decimal(10,2) NOT NULL,   `order_discount` decimal(10,2) NOT NULL,   `transaction_id` varchar(255) NOT NULL DEFAULT '',   `transaction_status` varchar(255) NOT NULL DEFAULT '',   `transaction_details` text NOT NULL,   `created_date` datetime NOT NULL COMMENT 'GMT',   `order_state` varchar(255) NOT NULL,   `order_state_id` int(11) NOT NULL,   `paypal_status` varchar(255) NOT NULL,   `ip_address` varchar(255) NOT NULL,   `customer_note` text NOT NULL,   `customer_language` varchar(255) NOT NULL,   PRIMARY KEY (`id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__j2store_ordershippings` (   `ordershipping_id` int(11) NOT NULL AUTO_INCREMENT,   `order_id` int(11) NOT NULL DEFAULT '0',   `ordershipping_type` varchar(255) NOT NULL DEFAULT '' COMMENT 'Element name of shipping plugin',   `ordershipping_price` decimal(15,5) DEFAULT '0.00000',   `ordershipping_name` varchar(255) NOT NULL DEFAULT '',   `ordershipping_code` varchar(255) NOT NULL DEFAULT '',   `ordershipping_tax` decimal(15,5) DEFAULT '0.00000',   `ordershipping_extra` decimal(15,5) DEFAULT '0.00000',   `ordershipping_tracking_id` mediumtext NOT NULL,   `created_date` datetime NOT NULL COMMENT 'GMT',   PRIMARY KEY (`ordershipping_id`),   KEY `idx_order_shipping_order_id` (`order_id`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `#__j2store_prices` (   `price_id` int(11) NOT NULL AUTO_INCREMENT,   `article_id` int(8) NOT NULL,   `item_price` decimal(11,3) NOT NULL,   `special_price` decimal(11,3) NOT NULL,   `item_tax` int(8) NOT NULL,   `item_shipping` int(8) NOT NULL,   `product_enabled` tinyint(2) NOT NULL,   `item_sku` varchar(255) NOT NULL,   `item_length` decimal(15,8) NOT NULL,   `item_width` decimal(15,8) NOT NULL,   `item_length_class_id` int(11) NOT NULL,   `item_weight` decimal(15,8) NOT NULL,   `item_weight_class_id` int(11) NOT NULL,   `item_height` decimal(15,8) NOT NULL,   `params` text NOT NULL,   PRIMARY KEY (`price_id`),   KEY `article_id` (`article_id`) ) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8;
